class Map:
    def __init__(self, game):
        self.game = game

        self.hit_boxes = hit_boxes

        self.map_layer_1_1 = map_layer_1_1
        self.map_layer_1_2 = map_layer_1_2
        self.map_layer_2 = map_layer_2
        self.tile_mappings = tile_mappings
        self.load_tiles()

        self.texture_mappings = texture_mappings
        self.load_textures()

        self.mappings = {**tile_mappings, **texture_mappings}

        self.back_drop_layer_1 = pygame.Surface((len(self.map_layer_1_1[0]) * TILE_WIDTH, len(self.map_layer_1_1) * TILE_HEIGHT))

        self.back_drop_layer_2 = pygame.Surface((len(self.map_layer_1_1[0]) * TILE_WIDTH, len(self.map_layer_1_1) * TILE_HEIGHT), pygame.SRCALPHA)

        self.load_map()

    def load_tiles(self):
        for id, texture in self.tile_mappings.items():
            texture = pygame.image.load(f'graphics/{texture}.png')
            self.tile_mappings[id] = texture

    def load_textures(self):
        for id, texture in self.texture_mappings.items():
            texture = pygame.image.load(f'graphics/{texture}.png')
            self.texture_mappings[id] = texture

    def load_map(self):
        for i in range(0, len(self.map_layer_1_1)):
            for j in range(0, len(self.map_layer_1_1[0])):
                if self.map_layer_1_1[i][j] != '_':
                    texture = self.mappings.get(self.map_layer_1_1[i][j])
                    self.back_drop_layer_1.blit(texture, (j * TILE_WIDTH, i * TILE_HEIGHT))
                if self.map_layer_1_2[i][j] != '_':
                    texture = self.mappings.get(self.map_layer_1_2[i][j])
                    self.back_drop_layer_1.blit(texture, (j * TILE_WIDTH, i * TILE_HEIGHT))
                if self.map_layer_2[i][j] != '_':
                    texture = self.mappings.get(self.map_layer_2[i][j])
                    self.back_drop_layer_2.blit(texture, (j * TILE_WIDTH, i * TILE_HEIGHT))
        self.back_drop_layer_1 = pygame.transform.scale(self.back_drop_layer_1, (self.back_drop_layer_1.get_width() * FACTOR, self.back_drop_layer_1.get_height() * FACTOR))
        self.back_drop_layer_2 = pygame.transform.scale(self.back_drop_layer_2, (self.back_drop_layer_2.get_width() * FACTOR, self.back_drop_layer_2.get_height() * FACTOR))

    def draw_map(self, map_offset_x, map_offset_y):
        self.game.screen.blit(self.back_drop_layer_1, (map_offset_x, map_offset_y))
        self.game.player.draw()
        self.game.screen.blit(self.back_drop_layer_2, (map_offset_x, map_offset_y))
